import React from "react";
import Head from "./header";

function Home() {

  return (
    <div>
      <Head />
      <div>
          <section>
              <div>
              <div>Lorem sups</div>
              <img src="./logo.svg"/>
              </div>
          </section>
      </div>
    </div>
  );
}

export default Home;
